import axios from "axios"

function checkUploadStatus(uploadID, access_token) {
      
      axios({
        method: 'get',
        url: `https://www.strava.com/api/v3/uploads/${uploadID}`,
        headers: { 
          Authorization: `Bearer ${access_token}`
        }
      })
      .then(response => {
        return response;
      })
      .catch(error => {
        return (error);
      });

}

export default checkUploadStatus;
